import React from 'react';
import ReactDOM from 'react-dom/client';
import App from './App';

/*
pour faire un rendu
de App va decouler toute notre application -> tous les composants
Ensuite on passe toute notre applicaton a document.getElementById("root") 
*/
ReactDOM.render(
  <React.StrictMode>

    <App /> 
  </React.StrictMode>,
  document.getElementById("root")
);
